import { NestFactory } from '@nestjs/core';
import { AppModule } from './app.module';
import * as express from 'express';

type Task = {
  id: number;
  title: string;
  completed: boolean;
  createdAt: string;
};

/**
 * In-memory task store.
 * This is a lightweight bootstrap to satisfy the TODO task without introducing
 * additional database dependencies. Data will reset when the server restarts.
 */
const tasks: Task[] = [];

async function bootstrap() {
  const app = await NestFactory.create(AppModule);
  app.enableCors();
  app.use(express.json());

  // List tasks
  app.get('/tasks', (req: any, res: any) => {
    res.json(tasks);
  });

  // Create a new task
  app.post('/tasks', (req: any, res: any) => {
    const { title } = req.body;
    if (!title || typeof title !== 'string') {
      res.status(400).json({ error: 'title is required' });
      return;
    }
    const t: Task = {
      id: Date.now(),
      title,
      completed: false,
      createdAt: new Date().toISOString(),
    };
    tasks.push(t);
    res.json(t);
  });

  // Update a task (title or completed)
  app.patch('/tasks/:id', (req: any, res: any) => {
    const id = Number(req.params.id);
    const t = tasks.find((x) => x.id === id);
    if (!t) {
      res.status(404).json({ error: 'Not found' });
      return;
    }
    if (req.body.title !== undefined) t.title = req.body.title;
    if (req.body.completed !== undefined) t.completed = req.body.completed;
    res.json(t);
  });

  // Delete a task
  app.delete('/tasks/:id', (req: any, res: any) => {
    const id = Number(req.params.id);
    const idx = tasks.findIndex((x) => x.id === id);
    if (idx >= 0) tasks.splice(idx, 1);
    res.status(204).send();
  });

  await app.listen(3001);
}
bootstrap();
