import React, { useEffect, useState } from 'react';
import axios from 'axios';

export type TodoItem = {
  id: number;
  title: string;
  completed: boolean;
  createdAt: string;
};

const TodoApp: React.FC = () => {
  const [tasks, setTasks] = useState<TodoItem[]>([]);
  const [title, setTitle] = useState<string>('');

  useEffect(() => {
    fetchTasks();
  }, []);

  const fetchTasks = async () => {
    try {
      const res = await axios.get<TodoItem[]>('/tasks');
      setTasks(res.data);
    } catch (err) {
      console.error('Failed to fetch tasks', err);
    }
  };

  const addTask = async () => {
    if (!title.trim()) return;
    const res = await axios.post<TodoItem>('/tasks', { title });
    setTasks((prev) => [...prev, res.data]);
    setTitle('');
  };

  const toggle = async (id: number) => {
    const t = tasks.find((x) => x.id === id);
    if (!t) return;
    await axios.patch(`/tasks/${id}`, { completed: !t.completed });
    setTasks((prev) =>
      prev.map((x) => (x.id === id ? { ...x, completed: !x.completed } : x))
    );
  };

  const remove = async (id: number) => {
    await axios.delete(`/tasks/${id}`);
    setTasks((prev) => prev.filter((t) => t.id !== id));
  };

  return (
    <div style={{ padding: '16px', maxWidth: 600 }}>
      <h2>Tasks</h2>
      <div>
        <input
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          placeholder="New task"
          onKeyDown={(e) => {
            if (e.key === 'Enter') addTask();
          }}
        />
        <button onClick={addTask} style={{ marginLeft: 8 }}>
          Add
        </button>
      </div>
      <ul style={{ listStyle: 'none', padding: 0, marginTop: 12 }}>
        {tasks.map((t) => (
          <li
            key={t.id}
            style={{
              display: 'flex',
              alignItems: 'center',
              gap: 8,
              padding: '6px 0',
            }}
          >
            <input
              type="checkbox"
              checked={t.completed}
              onChange={() => toggle(t.id)}
            />
            <span style={{ textDecoration: t.completed ? 'line-through' : 'none' }}>
              {t.title}
            </span>
            <button onClick={() => remove(t.id)} style={{ marginLeft: 'auto' }}>
              Delete
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TodoApp;
